import React from "react";
import './experience1.css'; 

const ExperienceCard = (jobTitle, dates, jobDescription, ) => {
    return (
        <div className="club">
            <div className="clubInfo">
                <h5>{jobTitle}</h5>
                {JSON.stringify(dates)}
            </div>
            {JSON.stringify(jobDescription)}
        </div>
    )
}

export default ExperienceCard;
